Nước chấm nên pha vừa miệng, thêm đu đủ xanh ngâm để tăng độ giòn.',
                'notes' => 'Người mỡ máu cao: nên hạn chế phần thịt ba chỉ nhiều mỡ.

Người tiểu đường: nên ăn vừa phải lượng bún (tinh bột).

Người ăn kiêng: tăng rau xanh để cân bằng dinh dưỡng.',
