                'title' => 'Cơm Tấm Sài Gòn',
                'slug' => 'com-tam-sai-gon',
                'description' => 'Cơm tấm là đặc sản nổi tiếng của Sài Gòn, thường gồm sườn nướng, bì, chả trứng ăn kèm cơm gạo tấm thơm dẻo, chan nước mắm pha chua ngọt và dưa chua. Đây là món ăn đậm đà, no lâu, gắn liền với văn hóa ẩm thực Nam Bộ.',
