                'instructions' => '[{"step": 1, "instruction": "Vo gạo tấm và nấu cơm"}, {"step": 2, "instruction": "Ướp sườn với nước mắm, đường, tỏi"}, {"step": 3, "instruction": "Nướng sườn trên than hoa"}, {"step": 4, "instruction": "Làm chả trứng"}, {"step": 5, "instruction": "Thái dưa leo, cà chua"}, {"step": 6, "instruction": "Bày cơm, sườn, chả và rau củ"}]',
                'tips' => 'Sườn nên được ướp qua đêm để thấm vị.

Nướng bằng than để tạo lớp cháy cạnh thơm ngon.

Nước mắm pha nên có vị cân bằng giữa mặn, ngọt, chua.',
                'notes' => 'Người tim mạch: nên ăn ít mỡ từ sườn nướng.

