                'slug' => 'goi-cuon-tom-thit',
                'description' => 'Gỏi cuốn tôm thịt là món ăn đặc trưng của ẩm thực Việt Nam, kết hợp hài hòa giữa tôm tươi, thịt luộc, bún và rau sống, tất cả được cuốn gọn trong bánh tráng mỏng. Khi chấm cùng nước mắm chua ngọt hoặc tương đậu phộng béo ngậy, hương vị trở nên thanh mát, cân bằng giữa đạm – rau – tinh bột, vừa ngon miệng vừa tốt cho sức khỏe.',
                'summary' => 'Gỏi cuốn tôm thịt thanh mát, đầy đủ dinh dưỡng với tôm, thịt, rau và bún, cuốn trong bánh tráng.',
