                'slug' => 'thit-luoc',
                'description' => 'Thịt luộc là món ăn dân dã, quen thuộc trong bữa cơm gia đình Việt Nam. Thịt heo được chọn lọc, luộc chín tới để giữ độ ngọt tự nhiên, mềm thơm và ít béo ngấy. Món thường ăn kèm rau sống, dưa leo và chấm cùng mắm tỏi ớt hoặc mắm nêm, mang lại hương vị hài hòa, thanh đạm nhưng đậm chất truyền thống.',
                'summary' => 'Món thịt luộc mềm ngọt, dễ ăn, thường kết hợp với rau sống và nước chấm đậm đà.',
