                'title' => 'Chè mít đác',
                'slug' => 'che-mit-dac',
                'description' => 'Chè mít đác là món tráng miệng giải nhiệt đặc trưng của mùa hè, kết hợp vị ngọt thơm của mít chín cùng sự giòn dai sần sật của hạt đác. Khi hòa quyện với nước cốt dừa béo ngậy, siro hoặc sữa tươi mát lạnh, món chè mang lại cảm giác thanh mát, dễ chịu, vừa ngon miệng vừa bổ dưỡng.',
                'summary' => 'Chè mít đác ngọt mát, giòn dai, kết hợp mít chín và hạt đác, thích hợp để giải nhiệt ngày hè.',
                'cooking_time' => 20,
