                'instructions' => '[{"step": 1, "instruction": "thêm sữa tươi vào cốc"}, {"step": 2, "instruction": "thái nhỏ mít và thêm mít đác"}]',
                'tips' => 'Chọn mít chín vừa, vàng thơm và ngọt.

Hạt đác nên ngâm với nước đường hoặc lá dứa để tăng hương vị.

Dùng nước cốt dừa nấu với chút muối để tạo độ béo mặn nhẹ, cân bằng vị ngọt.',
                'notes' => 'Người tiểu đường: nên hạn chế hoặc thay đường bằng chất ngọt ít calo.

